import React from 'react'
import StaLogoUrl from '../images/RoundAvatar.png'

const SafeArea = styled.SafeAreaView`
background: ${props => props.theme.colors.appBackground};
`
const StaLogoImage = styled.Image`
 width: 81px;
 height: 81px;
 margin-left: 16px;
 margin-top: 10px;
`


const StaLogo = () => {
    return (
        <SafeArea>
            <StaLogoImage source={StaLogoUrl}  />
        </SafeArea>
    )
}

export default StaLogo
